INSERT INTO `agribisnis` (`id_agribisnis`, `jenis_agribisnis`, `jenis_tembakau`, `deskripsi_agribisnis`, `file`, `gambar_agribisnis`) VALUES
('AGR0001', 'Agribisnis Tembakau Virginiaaa', '', 'Tembakau virginia juga disebut flue-cured virginia (FCV) atau bright tobacco sesuai dengan cara pengolahannya yang menggunakan aliran udara panas di dalam oven (curing-barn) dan menghasilkan kerosok yang berwarna lemon atau orange (Peedin 1999). Dalam perdagangan kerosok FCV ini sering disebut kerosok FC atau virginia FC. Di pasar internasional, tembakau virginia sebagian besar diperlukan untuk membuat rokok (sigaret), dan sebagian kecil dipergunakan untuk tembakau pipa serta untuk tembakau susur (chewing tobacco).', '15. AGRIBISNIS TEMBAKAU VIRGINIA.pdf', 'usahataniVirginia.jpg'),
('AGR0002', 'Prospek Nilai Ekonomi Tembakau Virginia', '', 'Tembakau virginia merupakan bahan baku rokok keretek dan rokok putih, sehingga perkembangannya di masa datang sangat dipengaruhi oleh perkembangan industri rokok. Faktor-faktor yang berpengaruh terhadap perkembangan industri rokok berbahan baku tembakau virginia di masa depan antara lain adalah: (1) Gerakan antirokok, (2) Pasar tembakau virginia, dan (3) Perkembangan produksi dan areal yang dipengaruhi oleh varietas dan budi daya yang sesuai, permodalan petani, dan penyediaan bahan  bakar untuk prosesing secara flue-cured. (Hal:171)', '16. PROSPEK NILAI EKONOMI TEMBAKAU VIRGINIA.pdf', '2.jpg'),
('AGR0003', 'Pola Kemitraan dalam Agribisnis Tembakau Virginia', '', 'Berbagai permasalahan yang terkait dengan agribisnis tembakau telah menjadi perhatian pemerintah. Masih lebih banyak petani yang belum bekerja sama dengan perusahaan sehingga mengalami kesulitan dalam melaksanakan budi daya tembakau virginia secara baik. Pemerintah telah membantu petani melalui Program Intensifikasi Tembakau Virginia (ITV) mulai tahun 1979. Pemerintah berfungsi sebagai  fasilitator dan menempatkan perusahaan rokok menjadi pengelola Program ITV. Bantuan pemerintah kepada petani berupa modal kerja dan sarana produksi berasal dari bank/lembaga keuangan yang ditunjuk dan dilewatkan para pengelola tersebut. Selanjutnya pengembalian pinjaman petani dilakukan melalui para pengelola. Dengan cara tersebut pengelola diposisikan sebagai penjamin dan bersifat avalis. (Hal:182)', '17. POLA KEMITRAAN DALAM AGRIBISNIS TEMBAKAU VIRGINIA.pdf', '3.jpg'),
('AGR0004', 'Agribisnis Tembakau Virginia', '', 'Dapat dikatakan bahwa usahatani tembakau virginia pada  tanah dengan kadar liat tinggi menghadapi masalah tingginya risiko kelebihan air, produktivitas rendah, dan kadar klor tinggi. Kelebihan kadar klor pada daun tembakau menyebabkan krosok sangat higroskopis, warna kotor, dan timbul aroma yang tidak dikehendaki (Rachman et al., 1986). Kenyatannya sebagian besar areal tembakau virginia dibudiayakan pada tanah berkadar liat tinggi. sebagai ilustrasi pada tahun 1995 areal tembakau virginia tingkat nasional seluas 42.250 ha, yang dibudiayakan pada tanah berkadar liat tinggi seluas 29.451 ha. adopsi teknologi oleh petani dalam upaya meningkatkan produktivitas dan mutu sangat lamban bahkan dapat dikatakan tidak jalan, petani dihadapkan pada resiko kegagalan karena iklim, pola pasar bebas menyebabkan petani harus menanggung resiko ketidakpastian pasar. (Hal:123)', 'agribisnis-tembakau-virginia.pdf', '4.jpg'),
('AGR0005', 'Agribisnis Tembakau Virginia Pola Kemitraan', '', 'Dengan pola kemitraan, banyak keuntungan yang dapat diperoleh masing-masing pihak yang ikut di dalamnya. Petani mitra usaha dapat memperoleh alih teknologi pengusahaan tembakau dari PT.BAT secara langsung dan berkesinambungan. Selain itu, petani juga memperoleh binaan dan pengalaman berhubungan dengan bank dalam pengusahaan tanaman tembakau. petani mitra usaha juga memperoleh jaminan pasr bagi produksinya sesuai dengan mutu dan harga yang telah diepakati. Harga yang terbentuk telah mempertimbangkan biaya produksi dan keuntungan petani yang diperlukan untuk menjamin kelangsungan usahatani nya. dengan bimbingan langsung secara intensif dari petugas PT.BAT baik dalam aspek teknologi maupun aspek lapangan lainnya, petani akan semakin luas wawasannya.', 'agribisnis-tembakau-virginia-pola-kemitraan.pdf', '5.jpg'),
('AGR0006', 'Usahatani Tembakau Madura', '', 'Petani penanam tembakau madura adalah petani yang umumnya memiliki lahan sempit (0,3-0,5 ha), bermodal tanah dan tenaga, serta menggunakan teknologi sederhana yang telah dikuasainya dari pengalaman secara turun temurun. Para petani tembakau bekerja secara bebas di lahan milik sendiri. Menurut Sumardjan (1997), petani tembakau adalah petani mandiri, dalam arti petani yang mempunyai peluang mengambil keputusan sendiri dalam usaha taninya. Namun demikian, ada faktor lain di luar dirinya yang ikut berpengaruh terhadap keterbatasan itu. faktor yang memengaruhi kebebasan yang dimiliki petani adalah keterbatasan modal dan tenaga. Untuk mengatasi dua faktor di atas, maka dibentuk lembaga oleh pemerintah dan lembaga yang dibentuk oleh petani sendiri. (Hal:86)', 'Usahatani-kelembagaan-pemasaran-tembakau-madura_2.pdf', '6.jpg'),
('AGR0007', 'Usahatani Tembakau Temanggung', '', 'Petani tembakau di Kabupaten Temanggung sepertinya sudah terikat dengan menanam tembakau sebagai tradisi, betapapun besar resikonya. Resiko yang dihadapi terutama berkaitan dengan iklim dan harga. Pilihan komoditas lain memang relatif sedikit, antara lain semangka, cabe, kentang, dan bawang putih. Tanaman alternatif tersebut adalah tanaman hltikultura yang memerlukan input yang lebih besar dibandingkan tembakau, mempunyai sifat mudah rusak, dan harganya berfluktuasi. Dalam rangka meningkatkan produktivitas dan kualitas tembakau rakyat, pemerintah c.q. Direktorat Jenderal Perkebunan telah mengadakan program Intensifikasi Tembakau Rakyat (ITR) yang dimulai tahun 1979. Dalam kaitan ini tembakau temanggung juga termasuk mendapat pengelolaan dari program intesifikasi tersebut. (Hal:101)', 'Usaha-tani-kelembgaan-dan-pemasran-tembakau-temanggung.pdf', '7.jpg'),
('AGR0008', 'Agribisnis Tembakau Virginia', '', 'Tembakau virginia juga disebut flue-cured virginia (FCV) atau bright tobacco sesuai dengan cara pengolahannya yang menggunakan aliran udara panas di dalam oven (curing-barn) dan menghasilkan kerosok yang berwarna lemon atau orange (Peedin 1999). Dalam perdagangan kerosok FCV ini sering disebut kerosok FC atau virginia FC. Di pasar internasional, tembakau virginia sebagian besar diperlukan untuk membuat rokok (sigaret), dan sebagian kecil dipergunakan untuk tembakau pipa serta untuk tembakau susur (chewing tobacco).', '15. AGRIBISNIS TEMBAKAU VIRGINIA.pdf', 'usahataniVirginia.jpg'),
