('AGR0025', 'Agribisnis Tembakau Virginia', '', 'Dapat dikatakan bahwa usahatani tembakau virginia pada  tanah dengan kadar liat tinggi menghadapi masalah tingginya risiko kelebihan air, produktivitas rendah, dan kadar klor tinggi. Kelebihan kadar klor pada daun tembakau menyebabkan krosok sangat higroskopis, warna kotor, dan timbul aroma yang tidak dikehendaki (Rachman et al., 1986). Kenyatannya sebagian besar areal tembakau virginia dibudiayakan pada tanah berkadar liat tinggi. sebagai ilustrasi pada tahun 1995 areal tembakau virginia tingkat nasional seluas 42.250 ha, yang dibudiayakan pada tanah berkadar liat tinggi seluas 29.451 ha. adopsi teknologi oleh petani dalam upaya meningkatkan produktivitas dan mutu sangat lamban bahkan dapat dikatakan tidak jalan, petani dihadapkan pada resiko kegagalan karena iklim, pola pasar bebas menyebabkan petani harus menanggung resiko ketidakpastian pasar. (Hal:123)', 'agribisnis-tembakau-virginia.pdf', '4.jpg'),
('AGR0026', 'Agribisnis Tembakau Virginia Pola Kemitraan', '', 'Dengan pola kemitraan, banyak keuntungan yang dapat diperoleh masing-masing pihak yang ikut di dalamnya. Petani mitra usaha dapat memperoleh alih teknologi pengusahaan tembakau dari PT.BAT secara langsung dan berkesinambungan. Selain itu, petani juga memperoleh binaan dan pengalaman berhubungan dengan bank dalam pengusahaan tanaman tembakau. petani mitra usaha juga memperoleh jaminan pasr bagi produksinya sesuai dengan mutu dan harga yang telah diepakati. Harga yang terbentuk telah mempertimbangkan biaya produksi dan keuntungan petani yang diperlukan untuk menjamin kelangsungan usahatani nya. dengan bimbingan langsung secara intensif dari petugas PT.BAT baik dalam aspek teknologi maupun aspek lapangan lainnya, petani akan semakin luas wawasannya.', 'agribisnis-tembakau-virginia-pola-kemitraan.pdf', '5.jpg'),
('AGR0027', 'Usahatani Tembakau Madura', '', 'Petani penanam tembakau madura adalah petani yang umumnya memiliki lahan sempit (0,3-0,5 ha), bermodal tanah dan tenaga, serta menggunakan teknologi sederhana yang telah dikuasainya dari pengalaman secara turun temurun. Para petani tembakau bekerja secara bebas di lahan milik sendiri. Menurut Sumardjan (1997), petani tembakau adalah petani mandiri, dalam arti petani yang mempunyai peluang mengambil keputusan sendiri dalam usaha taninya. Namun demikian, ada faktor lain di luar dirinya yang ikut berpengaruh terhadap keterbatasan itu. faktor yang memengaruhi kebebasan yang dimiliki petani adalah keterbatasan modal dan tenaga. Untuk mengatasi dua faktor di atas, maka dibentuk lembaga oleh pemerintah dan lembaga yang dibentuk oleh petani sendiri. (Hal:86)', 'Usahatani-kelembagaan-pemasaran-tembakau-madura_2.pdf', '6.jpg'),
('AGR0028', 'Usahatani Tembakau Temanggung', '', 'Petani tembakau di Kabupaten Temanggung sepertinya sudah terikat dengan menanam tembakau sebagai tradisi, betapapun besar resikonya. Resiko yang dihadapi terutama berkaitan dengan iklim dan harga. Pilihan komoditas lain memang relatif sedikit, antara lain semangka, cabe, kentang, dan bawang putih. Tanaman alternatif tersebut adalah tanaman hltikultura yang memerlukan input yang lebih besar dibandingkan tembakau, mempunyai sifat mudah rusak, dan harganya berfluktuasi. Dalam rangka meningkatkan produktivitas dan kualitas tembakau rakyat, pemerintah c.q. Direktorat Jenderal Perkebunan telah mengadakan program Intensifikasi Tembakau Rakyat (ITR) yang dimulai tahun 1979. Dalam kaitan ini tembakau temanggung juga termasuk mendapat pengelolaan dari program intesifikasi tersebut. (Hal:101)', 'Usaha-tani-kelembgaan-dan-pemasran-tembakau-temanggung.pdf', '7.jpg');
