('bd0001', 'PEMANFAATAN PUPUK ORGANIK DAN HAYATI', 'Coker319.jpg', 'Hasil penelitian Rachman et al. (1999) menunjukkan bahwa penggunaan OCF (organic\r\ncompound fertilizer) dengan dosis 600 kg/ha tanpa tambahan pupuk P dan K, cukup\r\nuntuk meningkatkan hasil tembakau virginia rajangan Bojonegoro dengan hasil rajangan\r\nkering', 'jawatimur', NULL, '2021-08-23', '16:00:00', 'Hara-dan-pemupukan-tembakau-temanggung.pdf', 'Coker319.jpg'),
('bd0002', 'PEMANFAATAN PUPUK ORGANIK DAN HAYATI', 'virginia', 'Hasil penelitian Rachman et al. (1999) menunjukkan bahwa penggunaan OCF (organic\r\ncompound fertilizer) dengan dosis 600 kg/ha tanpa tambahan pupuk P dan K, cukup\r\nuntuk meningkatkan hasil tembakau virginia rajangan Bojonegoro dengan hasil rajangan\r\nkering', 'lombok', NULL, '2021-08-23', '16:00:00', 'Hara-dan-pemupukan-tembakau-temanggung.pdf', 'Coker319.jpg\r\n'),
