('V0032', 'DSV0212', 'Varietas ini diperoleh dari hasil seleksi varietas lokal yang berasal dari Prancak, Kecamatan Pasongsongan, Kabupaten Sumenep. Varietas Prancak-95 dilepas oleh Menteri Pertanian pa-da tahun 1997 dengan SK nomor 731/Kpts/TP.240/7/97.Habitus tanaman seperti kerucut, bila telah dipangkas akan berbentuk silin-dris. Tinggi tanaman rata-rata berki-sar antara 60 dan 80 cm, jumlah daun 14-18 lembar. Bentuk daunnya oval agak sempit, duduk daun pada batang membentuk sudut lancip. Varietas ini tahan terhadap pe-nyakit lanas (Phytophthora nicotia-nae var. nicotianae). Produktivitasnya rata-rata 804 kg rajangan/ha, indeks mutu 57, kadar nikotin rata-rata 2,13%. Tembakau rajangan Prancak-95 mempunyai aroma yang harum dan gurih, sesuai untuk bahan baku rokok keretek. Varietas ini lebih sesuai untuk lahan kering, di daerah pegunungan dan tegalan. Dinas Perkebunan Kabupaten Pamekasan dan Sumenep mulai menangkarkan benih sebar Prancak-95 pada 1996 dan 1997. Benih sebar yang dihasilkan dibagikan kepada pedagang bibit sehingga bibit yang dipasarkan berasal dari sumber benih yang jelas. Produktivitas Prancak-95 di tingkat petani berkisar antara 0,45-0,8 ton/ha, tergantung jenis lahan dan pengelolaan ta-naman oleh petani. Saat ini penggunaan Prancak-95 diperkirakan mencapai 50-60% dari total areal tembakau madura, tersebar di Kabupaten Sumenep, Pamekasan, dan sebagian Sampang. Pengembangan tembakau madura Prancak-95 didukung dengan adanya kemitraan antara petani dan PT Sadhana Arifnusa (pemasok tembakau PT HM Sampoerna) dan pemasok PT PR Gudang Garam serta peran aktif dari instansi terkait. Dalam kemitraan ini, pengelola menyediakan benih sebar, sedangkan Dinas Perkebunan dan Kehutanan Kabupaten Pamekasan membina petani penangkar yang merangkap sebagai pedagang bibit.'),
