('V0009', 'DSV0244', 'Tembakau temanggung menyumbang 70-80% terhadap total pendapatan petani. Peranan tembakau temanggung untuk rokok keretek sangat penting karena berfungsi sebagai pemberi rasa dan aroma yang khas. Permasalahan yang ada di daerah pengembangan tembakau temanggung adalah penyakit lincat yang disebabkan oleh kompleks patogen Phytophthora nicotianae, Ralstonia solanacearum, dan Meloidogyne spp. dan degradasi lahan karena erosi. Oleh karena itu, telah dikembangkan varietas tahan penyakit licat, yaitu Kemloko-2 dan Kemloko-3 serta teknologi konservasi untuk menanggulangi erosi. Teknologi pengendalian erosi dan penyakit lincat dapat menurunkan tingkat erosi sebesar 66%, menekan kematian tanaman sebesar 44%, serta meningkatkan hasil dan mutu tembakau masing masing sebesar 31% dan 8%.'),
('V0010', 'DSV0245', 'Tembakau temanggung menyumbang 70-80% terhadap total pendapatan petani. Peranan tembakau temanggung untuk rokok keretek sangat penting karena berfungsi sebagai pemberi rasa dan aroma yang khas. Permasalahan yang ada di daerah pengembangan tembakau temanggung adalah penyakit lincat yang disebabkan oleh kompleks patogen Phytophthora nicotianae, Ralstonia solanacearum, dan Meloidogyne spp. dan degradasi lahan karena erosi. Oleh karena itu, telah dikembangkan varietas tahan penyakit licat, yaitu Kemloko-2 dan Kemloko-3 serta teknologi konservasi untuk menanggulangi erosi. Teknologi pengendalian erosi dan penyakit lincat dapat menurunkan tingkat erosi sebesar 66%, menekan kematian tanaman sebesar 44%, serta meningkatkan hasil dan mutu tembakau masing masing sebesar 31% dan 8%.'),
