('V0013', 'DSV0248', 'Tembakau kasturi adalah tembakau kerosok lokal VO sebagai bahan campuran (blending) untuk rokok keretek, yang dikembangkan di daerah Jember dan Bondowoso. Dari seluruh produksi nasional tembakau kasturi, 11,36% diekspor dengan label Besuki VO dan 88,64% dikonsumsi dalam negeri sebagai bahan baku rokok keretek. Pabrik Rokok Gudang Garam, Sampoerna, dan Djarum merupakan pengguna terbesar kerosok kasturi. Semula yang ditanam oleh petani adalah varietas lokal berupa populasi tanaman yang masih sangat beragam. Sejak tahun 1997 dilakukan pemuliaan untuk memperbaiki varietas lokal yang ada. Seleksi terhadap varietas lokal menghasilkan dua varietas yang diputihkan/dilepas pada tahun 2006, yaitu Kasturi 1 dan Kasturi 2 berdasarkan SK Mentan No: 132/Kpts/SR.120/2/ 2007 dan No: 133/Kpts/SR.120/2/2007. Saat ini luas areal penanaman tembakau kasturi pada dua daerah pengembangan mencapai 3.197 ha, dengan rata-rata produktivitas di tingkat petani mencapai 985 kg krosok/ha atau senilai Rp12.805.000,00'),
('V0014', 'DSV0249', 'Tembakau kasturi adalah tembakau kerosok lokal VO sebagai bahan campuran (blending) untuk rokok keretek, yang dikembangkan di daerah Jember dan Bondowoso. Dari seluruh produksi nasional tembakau kasturi, 11,36% diekspor dengan label Besuki VO dan 88,64% dikonsumsi dalam negeri sebagai bahan baku rokok keretek. Pabrik Rokok Gudang Garam, Sampoerna, dan Djarum merupakan pengguna terbesar kerosok kasturi. Semula yang ditanam oleh petani adalah varietas lokal berupa populasi tanaman yang masih sangat beragam. Sejak tahun 1997 dilakukan pemuliaan untuk memperbaiki varietas lokal yang ada. Seleksi terhadap varietas lokal menghasilkan dua varietas yang diputihkan/dilepas pada tahun 2006, yaitu Kasturi 1 dan Kasturi 2 berdasarkan SK Mentan No: 132/Kpts/SR.120/2/ 2007 dan No: 133/Kpts/SR.120/2/2007. Saat ini luas areal penanaman tembakau kasturi pada dua daerah pengembangan mencapai 3.197 ha, dengan rata-rata produktivitas di tingkat petani mencapai 985 kg krosok/ha atau senilai Rp12.805.000,00'),
