INSERT INTO `file_teknologi` (`id_file`, `id_teknologi_budidaya`, `nama_file`, `deskripsi_file`, `file`) VALUES
('F0001', 'TBD0001', 'Pesemaian Tembakau 2018', 'Pembuatan pesemaian tembakau diperlukan untuk mendapatkan bahan tanam yang bermutu dan sumbernya jelas,bersertifikat atau diperoleh dari penangkar. Tingkat keberhasilan petani tembakau sangat dipengaruhi oleh sumber benih dan bahan tanam yang berkualitas dengan parameter: kokoh, sehat, batang besar, daun 4-5 lembar. Berumur 40-50 Hari setelah sebar benih dan terbebas dari infeksi pathogen dan hama. Bahan tanam tembakau yang sehat dan kuat akan menghasilkan pertanaman yang tumbuh subur dan sehat mampu mencapai potensi hasil produksi dan mutu maksimal.', 'PESEMAIAN TEMBAKAU 2018.pdf'),
('F0002', 'TBD0002', 'Hara dan Pemupukan Tembakau Virginia', 'Produksi dan mutu tembakau dipengaruhi oleh banyak faktor meliputi faktor genetik, lingkungan  khususnya iklim dan tanah, serta teknik budi daya yang diterapkan. Salah satu faktor lingkungan yang  sangat menentukan produksi dan mutu tembakau adalah ketersediaan unsur hara, baik yang terkandung dalam tanah maupun yang berasal dari pupuk. Unsur hara tersebut secara langsung maupun tidak  langsung berpengaruh terhadap komposisi kimia daun tembakau.', '7. HARA DAN PEMUPUKAN TEMBAKAU VIRGINIA.pdf'),
('F0003', 'TBD0002', 'Hara dan Pemupukan Tembakau Temanggung', 'Produksi dan mutu tembakau sangat dipengaruhi ketersediaan unsur hara yang dibutuhkan tanaman selama pertumbuhannya. Oleh karena itu kelebihan atau kekurangan dalam ketersediaan unsur hara akan mempengaruhi produksi dan mutu tembakau. Misalnya, kelebihan unsur nitrogen akan menyebabkan fase pertumbuhan vegetatif lebih panjang, tertundanya pembungaan dan pemasakan daun, karena terjadi sintesis protein yang dominan. Sebaliknya, kekurangan ketersediaan nitrogen akan menghambat perkembangan kloroplas sehingga jumlah klorofil berkurang dan daun menjadi klorosis, yang akhirnya akan menyebabkan menurunnya berat kering daun.', 'Hara-dan-pemupukan-tembakau-temanggung.pdf'),
('F0004', 'TBD0002', 'Hara dan Pemupukan Tembakau Virginia', 'Walaupun tembakau virginia memerlukan banyak fosfor, tetapi pemberian fosfor yang berlebihan dapat merusak warna danaroma (Anonymous, 1957). Hal ini disebabkankarena adanya interaksi dengan hara lain. Dosis fosfor yang berlebihan dapat menyebabkan tanaman kekurangan seng (Zn), sehingga pembentukan suksin terhambat dan mengakibatkan tanaman kerdil, klorosis, dan bentuk daun abnormal (Tso, 1972). (Hal:56)', 'hara-dan-pemupukan-tembakau-virginia.pdf'),
('F0005', 'TBD0002', 'Pemupukan', 'Pemupukan pada tanaman tembakau ditujukan untuk mencukupi unsur hara hingga tanaman bisa membuahkan krosok yang tinggi baik jumlah ataupun kualitasnya.', 'pemupukan.pdf'),
('F0006', 'TBD0003', 'Penyakit Tanaman Tembakau Virginia', 'Penyakit tanaman merupakan salah satu faktor pembatas dalam budi daya tanaman, termasuk tembakau virginia. Berbagai penyakit yang disebabkan oleh berbagai macam patogen baik itu jamur, bakteri, virus, maupun nematoda diketahui dapat menyerang tanaman tembakau virginia. Pada prinsipnya, terjadinya penyakit pada suatu tanaman itu akibat adanya interaksi antara patogen yang virulen, tanaman yang rentan, serta kondisi lingkungan yang mendukung bagi perkembangan penyakit (Agrios 1997).', '10. PENYAKIT TANAMAN TEMBAKAU VIRGINIA.pdf'),
('F0007', 'TBD0003', 'Pengendalian Penyakit pada Tembakau Virginia', 'Pengendalian dengan pendekatan ekologi seperti penggunaan benih dan bibit sehat, sanitasi, pengelolaan lahan dengan tepat, pemberian pupuk organik secara teratur, dan rotasi tanaman harus menjadi kebiasaan petani dalam mengelola usaha taninya agar pertumbuhan tembakau sehat. Pengendalian penyakit  tembakau virginia akan lebih efektif jika usaha preventif didahulukan dengan menggunakan komponen-komponen pengendalian secara terpadu. Agar pengendalian sesuai target, maka identifikasi penyebab penyakit harus dilakukan sebelum menentukan strategi pengendaliannya. (Hal:123)', '11. PENGENDALIAN PENYAKIT PADA TEMBAKAU VIRGINIA.pdf'),
('F0008', 'TBD0003', 'Penyakit Tanaman Tembakau Madura dan Pengendaliannya', 'Penyakit merupakan salah satu kendala dalam usaha tani tembakau karena pada umumnya dapat menurunkan kualitas maupun kuantitas hasil tembakau. Namun, pada tembakau madura, penyakit masih belum menimbulkan masalah yang berarti sampai saat ini. Penyakit tanaman biasanya baru menimbulkan masalah apabila terjadi epidemi, sehingga pengendalian yang dilakukan menjadi tidak efektif karena sudah terlambat. (Hal:51)', 'Penyait-tanaman-tembakau-madura-pengenaliannya.pdf'),
('F0009', 'TBD0003', 'Penyakit Tanaman Tembakau Virginia dan Pengendaliannya', '', 'penyakit-tanaman-tembakau-virginia-dan-pengendaliannya.pdf'),
('F0010', 'TBD0003', 'Penyakit Tanaman Tembakau Temanggung dan Pengendaliannya', '', 'Penyakit-tembakau-temanggung-dan-pengendaliannya.pdf'),
('F0011', 'TBD0004', 'Hama Tanaman Tembakau', 'Serangan hama merupakan salah satu faktor yang dapat menurunkan produktivitas dan mutu tembakau. Berbagai jenis hama menyerang tanaman tembakau sejak di pembibitan, pertanaman, hingga di gudang penyimpanan. Seluruh bagian tanaman juga dapat diserang hama meliputi akar, batang, daun, bunga, sampai buah. Beberapa jenis hama yang menyerang saat pembibitan antara lain siput, semut merah, orong-orong, dan ulat. Jenishama yang menyerang saat di pertanaman antara lain ulat pupus, kutu, dan belalang. Hama yang menyerang tembakau di gudang penyimpanan antara lain kumbang tembakau.\nPengendalian hama tembakau yang efektif, aman, dan ramah lingkungan sangat penting dalam usaha budi daya tembakau. Guna mendukung keberhasilan usaha pengendalian, informasi tentang jenis hama, gejala serangan, biologi, ekologi, dan perilaku hama sangat diperlukan.\n(Hal:81)', '8. HAMA TANAMAN TEMBAKAU.pdf'),
('F0012', 'TBD0004', 'Pengendalian Hama Secara Terpadu', '', '9. PENGENDALIAN HAMA SECARA TERPADU PADA.pdf'),
('F0013', 'TBD0004', 'Hama Tembakau Madura dan Pengendaliannya', '', 'Hama-tembakau-madura-dan-pengendaliannya.pdf'),
('F0014', 'TBD0004', 'Serangga Hama Tembakau dan Pengendaliannya', '', 'Serangga-hama-tembakau-dan-pengendaiannya.pdf'),
('F0015', 'TBD0005', 'Panen dan Pengolahan Daun Tembakau Virginia', 'Di Indonesia, tembakau virginia (Nicotiana tabacum L.) banyak ditanam oleh petani untuk bahan utama pembuatan rokok dan obat-obatan. Oleh karena itu penanganan pas-capanen dan pengolahannya harus dilakukan dengan baik. Panen tembakau dilakukan apabila daun sudah cukup masak dengan cara memetik secara bertahap agar siap untuk diolah. Panen umumnya dilakukan dengan tangan dan pada saat pemetikan tersebut perlu diperhatikan tingkat kemasakan daun, saat, dan cara pemetikan, serta melindungi daun yang baru dipetik. Cara pemetikan yang baik adalah tanpa menimbulkan luka pada daun tersebut. (Hal:125)', '12. PANEN DAN PENGOLAHAN DAUN TEMBAKAU VIRGINIA.pdf'),
('F0016', 'TBD0005', 'Cara Panen dan Pengolahan Tembakau Rajangan Madura', '', 'Cara-panen-dan-pengolahan-tembakau-rajangan-madura.pdf'),
