('F0018', 'TBD0005', 'Panen dan Pengolahan Daun Tembakau Virginia', '', 'panen-dan-pengolahan-daun-tembakau-virginia.pdf'),
('F0019', 'TBD0005', 'Panen dan Pengolahan Tembakau Rajangan Temanggung', '', 'Panen-dan-pengolahan-tembakau-rajangan-temanggung.pdf'),
('F0020', 'TBD0006', 'Kesesuaian Lahan Tembakau Virginia di Kabupaten Bojonegoro', 'Salah satu sentra penanaman tembakau virginia adalah Kabupaten Bojonegoro. Perubahan-perubahan pada pertembakauan di Kabupaten Bojonegoro, yang menyangkut sebaran lahan perlu diidentifikasi. Tujuannya untuk mengevaluasi kesesuaian lahan tembakau di Kabupaten Bojonegoro dan evaluasi tersebut akan memberi informasi tentang kondisi kesuburan lahan dan tingkat kesesuaiannya dalam budi daya tembakau virginia, yang juga meliputi sebarannya. Uraian tentang hasil identifikasi kesesuaian lahan tembakau virginia di Kabupaten Bojonegoro ini diharapkan menjadi dasar pertimbangan dalam penetapan kesesuaian lahan untuk pengembangan tembakau virginia di Indonesia. (Hal:42)', '5. KESESUAIAN LAHAN TEMBAKAU VIRGINIA DI KABUPATEN BOJONEGORO.pdf'),
('F0021', 'TBD0006', 'Erosi dan Usaha Konservasi Lahan Tembakau di Temanggung', '', 'Erosi-dan-usaha-konservasi-lahan-tembakau-di-temanggung.pdf'),
('F0022', 'TBD0006', 'Iklim dan Tanah untuk Tembakau Virginia', '', 'Iklim-dan-tanah-untuk-tembakau-virginia.pdf'),
('F0023', 'TBD0006', 'Kesesuaian Lahan Tembakau di Kabupaten Bondowoso', '', 'Kesesuaian lahan Tembakau di Kabupaten Bondowoso.pdf'),
('F0024', 'TBD0006', 'Kesesuaian Lahan Tembakau di Kabupaten Sampang', '', 'Kesesuaian lahan tembakau di Kabupaten Sampang.pdf'),
('F0025', 'TBD0006', 'Kesesuaian Lahan Tembakau Virginia', '', 'kesesuaian lahan tembakau virginia.pdf'),
('F0026', 'TBD0006', 'Sifat Tanah Tembakau Madura', '', 'Sifat-tanah-tembakau-madura.pdf'),
('F0027', 'TBD0007', 'Sortasi dan Grading Tembakau Virginia', 'Sortasi dan grading pada tembakau virginia merupakan salah satu upaya untuk memberikan nilai tambah pada usaha tani tembakau, khususnya pada peningkatan nilai jual produk tembakau tersebut. Di satu sisi petani dapat menyajikan produk tembakaunya dalam kelas mutu yang sesuai ketentuan dan di sisi lain pembeli dapat memilih dan membeli tembakau sesuai dengan kebutuhannya. Dengan cara tersebut proses jual beli tembakau dapat lebih transparan karena mutu menjadi lebih tertata. (Hal:146)', '13. SORTASI DAN GRADING TEMBAKAU VIRGINIA.pdf'),
('F0028', 'TBD0007', 'Mutu Tembakau Madura', '', 'Mutu-tembakau-madura.pdf'),
('F0029', 'TBD0007', 'Penilaian dan Penetapan Mutu Tembakau Rajangan Temanggung', '', 'Penilaian-dan-penetapan-mutu-tembakau-rajangan-temanggung.pdf'),
('F0030', 'TBD0007', 'Sortasi dan Grading Tembakau Virginia', '', 'sortasi-dan-grading-tembakau-virginia.pdf'),
('F0031', 'TBD0003', 'Morfologi dan Biologi Tembakau Virginia', 'Pada umumnya semua tembakau (N. tabacum) mempunyai morfologi dan biologi hampir serupa sehingga cukup sulit untuk membedakan antartipe, terutama bagi yang belum mengenal berbagai tipe tembakau. Untuk memberikan gambaran, akan diuraikan morfologi pada bagian-bagian tanaman tembakau virginia. (Hal:3)', '1. MORFOLOGI DAN BIOLOGI TEMBAKAU VIRGINIA.pdf'),
('F0032', 'TBD0008', 'Biologi dan Morfologi Tembakau Madura', '', 'Biologi-dan-morfologi-tembakau-madura.pdf'),
('F0033', 'TBD0008', 'Biologi Tembakau Temanggung', '', 'Biologi-tembakau-temanggung.pdf'),
('F0034', 'TBD0001', 'Pesemaian Tembakau 2018', 'Pembuatan pesemaian tembakau diperlukan untuk mendapatkan bahan tanam yang bermutu dan sumbernya jelas,bersertifikat atau diperoleh dari penangkar. Tingkat keberhasilan petani tembakau sangat dipengaruhi oleh sumber benih dan bahan tanam yang berkualitas dengan parameter: kokoh, sehat, batang besar, daun 4-5 lembar. Berumur 40-50 Hari setelah sebar benih dan terbebas dari infeksi pathogen dan hama. Bahan tanam tembakau yang sehat dan kuat akan menghasilkan pertanaman yang tumbuh subur dan sehat mampu mencapai potensi hasil produksi dan mutu maksimal.', 'PESEMAIAN TEMBAKAU 2018.pdf'),
('F0035', 'TBD0002', 'Hara dan Pemupukan Tembakau Virginia', 'Produksi dan mutu tembakau dipengaruhi oleh banyak faktor meliputi faktor genetik, lingkungan  khususnya iklim dan tanah, serta teknik budi daya yang diterapkan. Salah satu faktor lingkungan yang  sangat menentukan produksi dan mutu tembakau adalah ketersediaan unsur hara, baik yang terkandung dalam tanah maupun yang berasal dari pupuk. Unsur hara tersebut secara langsung maupun tidak  langsung berpengaruh terhadap komposisi kimia daun tembakau.', '7. HARA DAN PEMUPUKAN TEMBAKAU VIRGINIA.pdf'),
('F0036', 'TBD0002', 'Hara dan Pemupukan Tembakau Temanggung', 'Produksi dan mutu tembakau sangat dipengaruhi ketersediaan unsur hara yang dibutuhkan tanaman selama pertumbuhannya. Oleh karena itu kelebihan atau kekurangan dalam ketersediaan unsur hara akan mempengaruhi produksi dan mutu tembakau. Misalnya, kelebihan unsur nitrogen akan menyebabkan fase pertumbuhan vegetatif lebih panjang, tertundanya pembungaan dan pemasakan daun, karena terjadi sintesis protein yang dominan. Sebaliknya, kekurangan ketersediaan nitrogen akan menghambat perkembangan kloroplas sehingga jumlah klorofil berkurang dan daun menjadi klorosis, yang akhirnya akan menyebabkan menurunnya berat kering daun.', 'Hara-dan-pemupukan-tembakau-temanggung.pdf'),
('F0037', 'TBD0002', 'Hara dan Pemupukan Tembakau Virginia', 'Walaupun tembakau virginia memerlukan banyak fosfor, tetapi pemberian fosfor yang berlebihan dapat merusak warna danaroma (Anonymous, 1957). Hal ini disebabkankarena adanya interaksi dengan hara lain. Dosis fosfor yang berlebihan dapat menyebabkan tanaman kekurangan seng (Zn), sehingga pembentukan suksin terhambat dan mengakibatkan tanaman kerdil, klorosis, dan bentuk daun abnormal (Tso, 1972). (Hal:56)', 'hara-dan-pemupukan-tembakau-virginia.pdf'),
('F0038', 'TBD0002', 'Pemupukan', 'Pemupukan pada tanaman tembakau ditujukan untuk mencukupi unsur hara hingga tanaman bisa membuahkan krosok yang tinggi baik jumlah ataupun kualitasnya.', 'pemupukan.pdf'),
('F0039', 'TBD0003', 'Penyakit Tanaman Tembakau Virginia', 'Penyakit tanaman merupakan salah satu faktor pembatas dalam budi daya tanaman, termasuk tembakau virginia. Berbagai penyakit yang disebabkan oleh berbagai macam patogen baik itu jamur, bakteri, virus, maupun nematoda diketahui dapat menyerang tanaman tembakau virginia. Pada prinsipnya, terjadinya penyakit pada suatu tanaman itu akibat adanya interaksi antara patogen yang virulen, tanaman yang rentan, serta kondisi lingkungan yang mendukung bagi perkembangan penyakit (Agrios 1997).', '10. PENYAKIT TANAMAN TEMBAKAU VIRGINIA.pdf'),
('F0040', 'TBD0003', 'Pengendalian Penyakit pada Tembakau Virginia', 'Pengendalian dengan pendekatan ekologi seperti penggunaan benih dan bibit sehat, sanitasi, pengelolaan lahan dengan tepat, pemberian pupuk organik secara teratur, dan rotasi tanaman harus menjadi kebiasaan petani dalam mengelola usaha taninya agar pertumbuhan tembakau sehat. Pengendalian penyakit  tembakau virginia akan lebih efektif jika usaha preventif didahulukan dengan menggunakan komponen-komponen pengendalian secara terpadu. Agar pengendalian sesuai target, maka identifikasi penyebab penyakit harus dilakukan sebelum menentukan strategi pengendaliannya. (Hal:123)', '11. PENGENDALIAN PENYAKIT PADA TEMBAKAU VIRGINIA.pdf'),
('F0041', 'TBD0003', 'Penyakit Tanaman Tembakau Madura dan Pengendaliannya', 'Penyakit merupakan salah satu kendala dalam usaha tani tembakau karena pada umumnya dapat menurunkan kualitas maupun kuantitas hasil tembakau. Namun, pada tembakau madura, penyakit masih belum menimbulkan masalah yang berarti sampai saat ini. Penyakit tanaman biasanya baru menimbulkan masalah apabila terjadi epidemi, sehingga pengendalian yang dilakukan menjadi tidak efektif karena sudah terlambat. (Hal:51)', 'Penyait-tanaman-tembakau-madura-pengenaliannya.pdf'),
('F0042', 'TBD0003', 'Penyakit Tanaman Tembakau Virginia dan Pengendaliannya', '', 'penyakit-tanaman-tembakau-virginia-dan-pengendaliannya.pdf'),
('F0043', 'TBD0003', 'Penyakit Tanaman Tembakau Temanggung dan Pengendaliannya', '', 'Penyakit-tembakau-temanggung-dan-pengendaliannya.pdf'),
('F0044', 'TBD0004', 'Hama Tanaman Tembakau', 'Serangan hama merupakan salah satu faktor yang dapat menurunkan produktivitas dan mutu tembakau. Berbagai jenis hama menyerang tanaman tembakau sejak di pembibitan, pertanaman, hingga di gudang penyimpanan. Seluruh bagian tanaman juga dapat diserang hama meliputi akar, batang, daun, bunga, sampai buah. Beberapa jenis hama yang menyerang saat pembibitan antara lain siput, semut merah, orong-orong, dan ulat. Jenishama yang menyerang saat di pertanaman antara lain ulat pupus, kutu, dan belalang. Hama yang menyerang tembakau di gudang penyimpanan antara lain kumbang tembakau.\nPengendalian hama tembakau yang efektif, aman, dan ramah lingkungan sangat penting dalam usaha budi daya tembakau. Guna mendukung keberhasilan usaha pengendalian, informasi tentang jenis hama, gejala serangan, biologi, ekologi, dan perilaku hama sangat diperlukan.\n(Hal:81)', '8. HAMA TANAMAN TEMBAKAU.pdf'),
