INSERT INTO `penyakit` (`id_penyakit`, `judul`, `jenis_tembakau`, `deskripsi`, `kota`, `file_gambar`, `file_SK`, `tanggal_pelepasan`, `tanggal_upload`, `waktu_upload`) VALUES
('P0001', 'HAMA TANAMAN TEMBAKAU', 'local', 'Serangan hama merupakan salah satu faktor yang dapat menurunkan produktivitas\r\ndan mutu tembakau. Berbagai jenis hama menyerang tanaman tembakau sejak di pembibitan, pertanaman, hingga di gudang penyimpanan. Seluruh bagian tanaman juga dapat diserang hama meliputi akar, batang, daun, bunga, sampai buah. Beberapa jenis hama yang\r\nmenyerang saat pembibitan antara lain siput, semut merah, orong-orong, dan ulat. Jenis\r\nhama yang menyerang saat di pertanaman antara lain ulat pupus, kutu, dan belalang. Hama yang menyerang tembakau di gudang penyimpanan antara lain kumbang tembakau.\r\nPengendalian hama tembakau yang efektif, aman, dan ramah lingkungan sangat\r\npenting dalam usaha budi daya tembakau. Guna mendukung keberhasilan usaha pengendalian, informasi tentang jenis hama, gejala serangan, biologi, ekologi, dan perilaku hama\r\nsangat diperlukan.', 'madura', 'hama.jpg', '8. HAMA TANAMAN TEMBAKAU.pdf', NULL, '2021-08-18', '13:00:00'),
