INSERT INTO `teknologi_budidaya` (`id_teknologi_budidaya`, `jenis_teknologi_budidaya`, `jenis_tembakau`, `deskripsi`, `gambar_tekno`) VALUES
('TBD0001', 'Pesemaian', '', 'Pembuatan pesemaian tembakau diperlukan  untuk mendapatkan bahan tanam yang bermutu dan sumbernya jelas,bersertifikat atau diperoleh dari penangkar.  Tingkat keberhasilan petani tembakau sangat dipengaruhi oleh sumber benih dan bahan tanam yang berkualitas dengan parameter: kokoh, sehat, batang besar, daun 4-5 lembar.  Berumur 40-50 Hari setelah sebar benih dan terbebas dari infeksi pathogen dan hama. Bahan tanam tembakau yang   sehat dan kuat akan menghasilkan pertanaman yang tumbuh subur dan sehat mampu mencapai potensi hasil produksi dan mutu maksimal.', 'pesemaian.jpg'),
('TBD0002', 'Pemupukan', '', 'Produksi dan mutu tembakau dipengaruhi oleh banyak faktor meliputi faktor genetik, lingkungan khususnya iklim dan tanah, serta teknik budi daya yang diterapkan. Salah satu faktor lingkungan yang sangat menentukan produksi dan mutu tembakau adalah ketersediaan unsur hara, baik yang terkandung dalam tanah maupun yang berasal dari pupuk. Unsur hara tersebut secara langsung maupun tidak langsung berpengaruh terhadap komposisi kimia daun tembakau. Setiap jenis tembakau mempunyai komposisi kimia berbeda-beda, sehingga imbangan hara yang dibutuhkan juga berbeda.', 'pemupukan.JPG'),
('TBD0003', 'Pengendalian penyakit', '', 'Penyakit tanaman muncul akibat adanya serangan patogen yang virulen pada tanaman inang yang rentan, dan lingkungan di sekitar mendukung. Kerugian yang diakibatkan oleh penyakit pada tanaman tembakau cukup signifikan dan sering menyebabkan gagal panen sehingga kerugian yang diderita petani cukup besar. Selain ketiga faktor di atas, kebiasaan petani menanam tembakau bersama atau rotasi dengan tanaman inang serta sistem usaha tani tembakau yang intensif selama bertahun-tahun menyebabkan lingkungan mikro di suatu lahan kondusif bagi berkembangnya suatu penyakit. Berkurangnya keanekaragaman tanaman di suatu lingkungan juga mengakibatkan menurunnya keanekaragaman mikroba sehingga didominasi oleh satu atau dua patogen yang umum menyerang tanaman di lahan tersebut. Di lapangan seringkali dijumpai lebih dari satu macam gejala penyakit, bahkan kadang-kadang bergabung menjadi satu sehingga menyulitkan pengendalian. Ada dua cara pengendalian penyakit yang umum dilakukan, yaitu pencegahan (preventif) dan pengobatan (kuratif). Tindak pencegahan agar tidak terjadi penyakit merupakan tindakan yang bijaksana dan lebih efektif. Sedangkan tindak pengobatan membutuhkan waktu yang relative lama bahkan seringkali gagal karena patogen terlanjur berkembang banyak. Oleh karena itu penting bagi petani untuk memonitor pertumbuhan tanaman tembakaunya. Mengenali gejala awal dan segera melakukan tindak pencegahan berkembang dan menyebarnya penyakit akan sangat efektif mengurangi kerugian. Tindak pencegahan suatu penyakit dilakukan dengan mengintegrasikan komponenkomponen pengendalian secara harmoni dalam seluruh sistem usaha tani agar hasilnya efektif. Dasar pengendalian terpadu antara lain identifikasi penyebab penyakit dengan tepat, dan pengenalan siklus hidup maupun sifat-sifat patogen seperti cara bertahan hidup, cara penularan ataupun penyebaran, inang selain tembakau, dan perkembangan penyakit berhubungan dengan vektor serangga dan sebagainya. Dengan demikian pengendalian penyakit tidak dilakukan pada saat terjadi serangan, tetapi dimulai dengan melakukan kebiasaan- kebiasaan untuk menjaga agar pertumbuhan tembakau sehat dan optimum. Kebiasaan yang perlu dilakukan untuk mencegah terjadinya ledakan penyakit sudah harus dimulai sejak persiapan bedengan, seperti: penggunaan benih bersertifikat, sehat dan seragam, sanitasi, pengelolaan lahan, serta monitoring secara periodik. Sedang pencegahan penyakit di lapangan dilakukan dengan rotasi tanaman, pengolahan lahan, pemberian bahan organik, monitoring secara periodik. Pengendalian dengan menggunakan pestisida kimia dilakukan jika kondisi lingkungan sangat mendukung perkembangan penyakit. Kegiatan-kegiatan tersebut di atas merupakan komponen pengendalian yang harus dilaksanakan secara terpadu agar diperoleh pengendalian yang efektif, efisien, dan aman.', 'pengendalianPenyakit.JPG'),
('TBD0004', 'Pengendalian hama', '', 'Serangan hama merupakan salah satu faktor yang dapat menurunkan produktivitas dan mutu tembakau. Berbagai jenis hama menyerang tanaman tembakau sejak di pembibitan, pertanaman, hingga di gudang penyimpanan. Seluruh bagian tanaman juga dapat diserang hama meliputi akar, batang, daun, bunga, sampai buah. Beberapa jenis hama yang menyerang saat pembibitan antara lain siput, semut merah, orong-orong, dan ulat. Jenis hama yang menyerang saat di pertanaman antara lain ulat pupus, kutu, dan belalang. Hama yang menyerang tembakau di gudang penyimpanan antara lain kumbang tembakau. Pengendalian hama tembakau yang efektif, aman, dan ramah lingkungan sangat penting dalam usaha budi daya tembakau. Guna mendukung keberhasilan usaha pengendalian, informasi tentang jenis hama, gejala serangan, biologi, ekologi, dan perilaku hama sangat diperlukan.Tujuan implementasi PHT pada tanaman tembakau adalah untuk memasyarakatkan penggunaan pestisida kimia secara rasional, mengurangi kerusakan lingkungan, dan bahaya pestisida terhadap kesehatan, memasyarakatkan metode alternatif pengendalian hama, dan memenuhi UU RI No. 12 Tahun 1992 tentang Sistem Budi Daya Tanaman. Sasarannya adalah lingkungan hidup lestari dan tercapainya pertanian berkelanjutan, pendapatan petani meningkat, diperoleh bahan baku tembakau berkualitas, aman residu pestisida, biaya produksi terkontrol dan harga kompetitif, serta bisnis tembakau yang  berkesinambungan.', 'pengendalianHama.JPG'),
('TBD0005', 'Panen dan pasca panen', '', 'Panen tembakau dilakukan apabila daun sudah cukup masak dengan cara memetik secara bertahap agar siap untuk diolah. Panen umumnya dilakukan dengan tangan dan pada saat pemetikan tersebut perlu diperhatikan tingkat kemasakan daun, saat, dan cara pemetikan, serta melindungi daun yang baru dipetik. Cara pemetikan yang baik adalah tanpa menimbulkan luka pada daun tersebut. Pengolahan daun tembakau bertujuan untuk mengubah daun tembakau menjadi bahan setengah jadi berupa kerosok atau rajangan. Sebagai bahan baku rokok, daun tembakau yang sudah diolah menjadi kerosok atau rajangan, masih harus melalui proses penstabilan mutu (aging) sehingga menjadi bahan jadi yang siap diracik  menjadi rokok. Pengolahan tembakau dikategorikan sebagai proses kiuring (curing) yaitu proses untuk mengubah daun tembakau segar menjadi kerosok sehingga akhirnya daun tembakau dapat dimanfaatkan oleh perusahaan (Voges 1984). Hall (1971) mendefinisikan kiuring sebagai usaha untuk mendapatkan perubahan fisiologis tertentu pada daun tembakau dengan mengatur suhu dan kelembapan lingkungan.', 'panen.JPG'),
('TBD0006', 'Kesesuaian lahan', '', 'Kesesuaian lahan dapat diartikan sebagai kecocokan dari sebidang lahan untuk penggunaan tertentu. Sementara evaluasi lahan merupakan proses untuk menentukan tingkat kesesuaian lahan tersebut (FAO 1976). Evaluasi lahan dinilai pada setiap satuan peta tanah (SPT) di lokasi studi. Identifikasi kesesuaian lahan dilakukan berdasarkan Hukum Minimum Liebig, yaitu mencocokkan (matching) antara kualitas lahan dan karakteristik lahan sebagai parameter dengan kriteria kelas kesesuaian lahan yang telah disusun berdasarkan persyaratan penggunaan atau persyaratan tumbuh tanaman tembakau. Struktur klasifikasi kesesuaian lahan ditetapkan berdasarkan sistem yang telah dikembangkan oleh FAO (1976) dan telah dipakai secara luas dalam survei dan penilaian tanah di Indonesia (Puslit Tanah 1983).', 'kesesuaianLahan.JPG'),
('TBD0007', 'Sorting dan Grading', '', 'Secara umum mutu tembakau sangat dipengaruhi beberapa faktor yaitu genetik, lingkungan, teknik budi daya, posisi daun pada batang, cara panen, dan pengolahannya. Mutu tembakau dapat ditinjau dari aspek fisik, kimia, dan sensori. Aspek fisik meliputi warna, keseragaman, ukuran kerosok (ukuran rajangan), besarnya ibu tulang daun dan tulang daun, ketebalan daun, elastisitas, daya bakar, dan daya mekar (filling-power). Aspek kimia antara lain terdiri atas kadar gula, nikotin, nitrogen, pati, lemak, minyak, jumlah asam menguap (total volatile acid = TVA), sedangkan aspek sensori adalah rasa dan aroma asap tembakau. Di dalam daun tembakau terdapat beberapa komponen kimia yang berpengaruh terhadap mutu tembakau, walaupun para peneliti umumnya masih berbeda pendapat mengenai peran masing-masing komponen kimia tersebut (Mendell et al. 1984). Tso (1972) menyatakan bahwa jumlah komponen kimia tersebut sekitar 400 senyawa. Mutu tembakau selain ditentukan oleh banyaknya komponen kimia yang dikandung, juga ditentukan oleh kombinasi atau persentase komposisi kimia yang terdapat di dalamnya. Saat ini ada kecenderungan mengaitkan mutu tembakau dengan kandungan tar dan nikotin yang ada dalam rokok. Hal ini sehubungan dengan makin banyaknya rokok yang dirancang dengan kadar tar dan nikotin rendah untuk mengurangi bahaya merokok terhadap kesehatan. Tar adalah endapan (condensate) dari asap rokok, setelah dihilangkan bagian nikotin dan airnya (Voges 1984). Tar pada tembakau merupakan sisa pembakaran komponen-komponen seperti selulosa, gula, nitrogen total, lemak, minyak, atau asam organik yang lain, sedangkan pada rokok yang menggunakan saus dimasukkan juga sisa pembakaran saus (licorice atau liquorice) atau bahan lain yang ditambahkan. Mutu tembakau yang memuat informasi kadar tar dan nikotin diharapkan dapat memenuhi kepentingan industri rokok yang akan memproduksi berbagai racikan atau campuran (blend) dengan kadar tar dan nikotin tertentu. Kriteria mutu tembakau yang disusun oleh para ahli terdahulu cukup sulit dimengerti karena terlalu banyaknya faktor yang digunakan sebagai tolok ukur penentuan mutu. Tolok ukur mutu paling utama untuk tembakau adalah rasa dan aroma asap dari rokok yang dihasilkan. Karena tidak semua orang dapat mendeteksi rasa dan aroma, maka rasa dan aroma ditentukan dengan menggunakan unsur fisik antara lain warna dan elastisitas serta senyawa kimia seperti kandungan gula, nikotin, dan lain-lain. Sesuai definisi penilaian mutu tembakau yang telah tersusun sebelumnya, mutu dapat dilihat dari berbagai kepentingan yang semuanya masih dibatasi oleh aspek ekonomi dan perkiraan rasa dan aroma yang diharapkan. Tso (1972) memberi gambaran bahwa mutu tembakau mempunyai pengertian yang relatif, yang dapat  berubah karena pengaruh orang, waktu, dan tempat.', 'sortasi.JPG'),
('TBD0008', 'Morfologi dan Biologi', '', 'Tembakau termasuk kelompok tumbuhan beracun (night shade). Dalam susunan taksonominya tanaman tembakau termasuk famili Solanaceae dan genus Nicotiana (Ochse et al. 1961). Menurut Goodspeed (1954) dan Smith (1979), genus ini mempunyai tiga subgenus, yaitu:\n1. Rustica, mempunyai 3 seksi dengan 9 spesies\n2. Tabacum mempunyai 2 seksi dengan 6 spesies\n3. Petunioides mempunyai 9 seksi dengan 45 spesies.\nKarena terjadi gradasi pada spesies tertentu, Wells (1960) mengusulkan revisi jumlah spesies dari 60 menjadi 64. Secara alami spesies-spesies tersebut dijumpai tumbuh liar di Amerika, Australia, dan Pasifik Selatan. Beberapa spesies liar tersebut mempunyai arti penting dalam pemuliaan tanaman. N. glutinosa L. digunakan sebagai sumber ketahanan terhadap penyakit mosaik, N.longiflora Cav. dan N.plumbaginifolia Viv. digunakan sebagai sumber ketahanan terhadap Phytophthora nicotianae (Wernsman dan Matzinger 1980), sedangkan N.debneyi Dom. merupakan sumber ketahanan terhadap Peronopsora tabacina (Clayton1968). N. sanderae dimasukkan dalam kelompok tanaman hortikultura karena memiliki nilai ornamental.\n', 'biologi.JPG');
