INSERT INTO `waktu_tanam` (`id_waktu_tanam`, `nama_file`, `deskripsi`, `file`) VALUES
('WT0001', 'Perencanaan Waktu Tanam Tembakau Virginia', 'Periode kering digunakan untuk menentukan waktu tanam tembakau virginia. Umur tanaman tembakau virginia sekitar 120 hari (12 dasarian) dan dibutuhkan periode kering sekitar 2 bulan terakhir. Periode kering pada daerah pengembangan tembakau virginia lebih dari 12 dasarian dan cukup panjang untuk kebutuhan pemasakan daun dan panen. Waktu tanam dapat dimulai awal musim kemarau untuk menghindari genangan air dan paling lambat 12 dasarian sebelum akhir musim kemarau. Awal waktu tanam sama dengan awal musim kemarau (Tabe1 1). Oleh karena masa tanam tembakau pada periode kering, sehingga diperlukan air irigasi untuk memenuhi kebutuhan air tanaman. Anjuran waktu tanam tembakau virginia di atas bersifat patokan umum yang didasarkan peluang dan rata-rata curah hujan dan bersifat normal.</p>Dalam skala operasional pengelolaan tanaman diperlukan informasi prakiraan cuaca untuk musim tanam bersangkutan, apakah awal musim kemarau maju atau mundur ataukah lebih kering atau lebih basah dari keadaan normal. Informasi prakiraan cuaca dapat diperoleh di www.bmkg.go.id untuk seluruh wilayah tembakau virginia di Indonesia dan khusus di Jawa Timur dapat mengakses di <span style=font-style:italic>http://www.staklimkarangploso.net</span>, Informasi tersebut diharapkan telah diketahui sebelum menebar benih tembakau sampai saat menjelang panen. Contoh informasi hasil prakiraan awal musim kemarau tahun 2011 dari BMKG yang telah di upload pada hari Kamis, 25 Maret 2011, pukul 14:06 administrator Publikasi?Klimatologi (Gambar 5). Dari gambar 5 diketahui bahwa Kabupaten Bojonegoro (Zona 88) berwarna hijau artinya prakiraan awal musim kemarau mundur 2 dasarian/dekade dari rata-ratanya April II/III, yaitu Mei I/II. Lamongan (Zona 90) berwarna putih/abu-abu artinya prakiraan awal musim kemarau mundur 1 dasarian dari rata-ratanyaApril I/II (Utara) dan Mei II (Selatan), yaitu April II/III (Utara) dan Mei III (Selatan). Ngawi (Zona 87) berwarna kuning artinya prakiraan awal musim kemarau sama dengan rata-ratanya yaitu Mei I/II.</p>', '6. KETERKAITAN ANTARA KONDISI IKLIM DAN PERENCANAAN TANAM TEMBAKAU VIRGINIA.pdf'),
('WT0002', 'Waktu Tanam Tembakau Temanggung', 'Musim kemarau digunakan sebagai patokan dalam menentukan waktu tanam tembakau temanggung. Umur tanaman tembakau temanggung termasuk prosesing sekitar 140-150 hari (14-15 dasarian) dan dibutuhkan periode kering sekitar 7-8 dasarian terakhir. Periode kering pada daerah pengembangan tembakau temanggung sekitar 9-15 dasarian(tabel 1) dan cukup waktu untuk kebutuhan pemasakan daun, panen, dan prosesing. Waktu tanam paling awal dihitung minimal 6 dasarian dari awal musim kemarau. Waktu tanam paling lambat dihitung 15 dasarian sebelum akhir musim kemarau. Oleh karena periode kering terbatas, waktu tanam dilaksanakan pada musim hujan. Waktu tanam paling awal sckitar Maret III-April II dan paling lambat April II-Mei II</p>', 'Curah-hujan-dan-waktu-tanam-tembakau-temanggung.pdf'),
('WT0003', 'Implikasi Penentuan Waktu Tanam Tembakau Madura', 'Penentuan waktu tanam tembakau madura tersebut bersifat patokan yang didasarkan peluang dan rata-rata curah hujan normal. Pengaturan waktu tanam tembakau madura sangat penting untuk mencapai hasil yang tinggi dengan mutu yang dikehendaki konsumen. Dalam skala operasional dapat dipadukan dengan hasil penelitian pemberian air pada tanaman tembakau madura terutama untuk menghindari kekeringan. Informasi ini diharapkan telah diketahui oleh pengguna sebelum kegiatan menebar benih dan saat menjelang panen.</p>Tembakau gunung ditanam pada musim penghujan dan kebutuhan aimya hanya dipenuhi dari curah hujan selama fase vegetatif. Waktu tanamnya dianjurkan tanam mengikuti seri I dimana peluang 75% diharapkan akan lebih pasti mendapat hujan dibanding normalnya. Tembakau tegal dan sawah yang mendapat tambahan air siraman dianjurkan mengikuti lanam seri II. Tembakau sawah dengan permukaan air tanah dangkal sekitar 2 meter dianjurkan mengikuti tanam seri III.</p>Anjuran pemberian air tanaman tembakau madura pada tanah tegal adalah 0,5 l/tanaman/pemberian dengan pemberian tiap hari sampai umur 20 hari, dan diikuti penyiraman 2,0 l/tanaman/pemberian/yang diberikan pada periode 21-40 hari (tiap dua hari), 41-50 hari (tiap hari). 51-54 hari (tiap 2 hari), dan 50-60 hari (tiap 3 hari) atau total pemberian air sebesar 174 mm (Rachman et al., 1993).</p>Anjuran pemberian air tanaman tembakau madura pada tanah sawah adalah 0,25 l/tanaman/pemberian dengan pernberian tiap hari sampai umur 20 hari, dan diikuti penyiraman 0,66 l/tanaman/ pemberian yang diberikan pada periode 21-40 hari (tiap 2 hari). 41-50 hari (tiap hari), 51-54 hari (tiap 2 hari), dan 50-60 hari (tiap 3 hari) atau total pemberian air sebesar 63 mm (Ilyas, 1993).</p>', 'Sifat-iklim-penentuan-waktu-tanam-tembakau-madura.pdf');
